// src/Components/AboutPage.jsx
import React from "react";

const styles = {
  page: {
    fontFamily:
      'system-ui, -apple-system, "Segoe UI", Roboto, Inter, "Helvetica Neue", Arial, sans-serif',
    padding: "24px 48px",
    flex: 1,
  },
  title: {
    fontSize: "2rem",
    marginBottom: "16px",
  },
  text: {
    fontSize: "1rem",
    lineHeight: "1.5",
    maxWidth: "800px",
  },
};

export default function AboutPage() {
  return (
    <main style={styles.page}>
      <h1 style={styles.title}>About PriceWise</h1>
      <p style={styles.text}>
        PriceWise is a price comparison tool designed to help you find the
        best deals on your favorite products. Our mission is to make shopping
        smarter and more affordable for everyone.
      </p>
    </main>
  );
}
